INSERT INTO `catalogue_pages` (`id`, `orderid`, `accessrole`, `name`, `layout`, `img_headline`, `img_teasers`, `body`, `label_pick`, `extratext`, `label_extra_t`) VALUES
(1, 1, 1, 'Frontpage', 'ctlg_frontpage2', 'catal_fp_header', 'catal_fp_pic4,catal_fp_pic5,', 'Need some Furni for your Habbo room?  Well, you’re in the right place!  This Catalogue is packed FULL of funky Furni, just click the tabs on the right to browse.<br><br>We regularly add and remove Furni, so check back regularly for new items.<br><br>', NULL, 'Need some dildos for your Habbo room?', '1:You need Credits to buy Furni for your room, click the Purse at the bottom of your screen for more information about Credits.'),
(22, 22, 1, 'Sports', 'ctlg_layout2', 'catalog_sports_headline1', 'catalog_sports_teaser1,', 'For the sporty people, here is the Sports section! Create your own hockey stadium!', 'Click on the item you want for more information', '2:Yay!', NULL),
(23, 23, 1, 'Rugs', 'ctlg_layout2', 'catalog_rugs_headline1', 'catalog_rugs_teaser1,', 'We have rugs for all occasions. All rugs are non-slip and washable.', 'Click on the item you want for more information', '2:We have rugs for ANY room!', NULL),
(3, 3, 1, 'Spaces', 'ctlg_spaces', 'catalog_spaces_headline1', '', 'Are you walls looking a little gay? What you need is a splash of paint and this is the place to sooo get it! <br><br>A splash of sperm on the walls and a nice jew on the floor can make all the difference. Use the virtual room below to test stuff out before you buy!', NULL, NULL, '1:Wall\r\n2:Floor\r\n3:Pattern\r\n4:Colour\r\n5:Pattern\r\n6:Colour\r\n7:Preview'),
(2, 2, 1, 'Rare', 'ctlg_productpage1', 'catalog_rares_headline1', '', 'Project Blunk revives Mountain Dew!<br>At the expense of just 25 Credits (that''s even less than one jew!) you can have this oldschool scripting beauty in your sweaty /b/tard hands.<br>Enjoy it while it lasts!', NULL, NULL, NULL),
(24, 24, 1, 'Gallery', 'ctlg_layout2', 'catalog_gallery_headline1', 'catalog_gallery_teaser1,', 'Adorn your walls with wondrous works of art, posters, plaques and wall hangings. We have items to suit all tastes, from kitsch to cool, traditional to modern.', 'Click on the item you want for more information', '2: Brighten up your walls!', NULL),
(25, 25, 1, 'Christmas', 'ctlg_layout2', 'catalog_christmas_headline1', 'catalog_christmas_teaser1', 'Wow, Christmas came early. And Nillus is a cunt. Lawl.', NULL, 'Click on a furni for more information.', NULL),
(6, 6, 1, 'Teleporters', 'ctlg_productpage3', 'catalog_doors_headline1', 'catalog_door_a,catalog_door_c,catalog_door_b,', 'Beam your user from one room to another with one of our cunningly disguised, space age teleports. Now you can link any two rooms together! Teleports are sold in pairs, so if you trade for them, check you''re getting a linked pair.', 'Click on the item you want for more information', 'Beam!', NULL),
(9, 9, 1, 'Area', 'ctlg_layout2', 'catalog_area_headline1', 'catalog_area_teaser1,', 'Introducing the Area Collection...  Clean, chunky lines set this collection apart as a preserve of the down-to-earth person. It''s beautiful in its simplicity, and welcoming to everyone.', 'Click on the item you want for more information', '2: Beautiful in it''s simplicity!', NULL),
(12, 12, 1, 'Candy', 'ctlg_layout2', 'catalog_candy_headline1', 'catalog_candy_teaser1,', 'Sleek, girly and a total ripoff of the Mode collection. We present to you the one and only Candy range!<br>Decorate your room with these items and express your feministihingsthangthing feelings!', 'Click on the item you want for more information', '2: WTF SCREW YOU LOL', NULL),
(14, 14, 1, 'Iced', 'ctlg_layout2', 'catalog_iced_headline1', 'catalog_iced_teaser1,', 'Introducing the Iced Collection...  For the person who needs no introduction. It''s so chic, it says everything and nothing. It''s a blank canvas, let your imagination to run wild!', 'Click on the item you want for more information', '2: These chairs are so filthy', NULL),
(15, 15, 1, 'Lodge', 'ctlg_layout2', 'catalog_lodge_headline1', 'catalog_lodge_teaser1,', 'Introducing the Lodge Collection...  Do you appreciate the beauty of wood?  For that ski lodge effect, or to match that open fire... Lodge is the Furni of choice for people with that no frills approach to decorating.', 'Click on the item you want for more information', '2: I luv wood!', NULL),
(16, 16, 1, 'Plasto', 'ctlg_plasto', 'catalog_plasto_headline1', '', 'Introducing The Plasto Collection...  Can you feel that 1970s vibe?  Decorate with Plasto and add some colour to your life. Choose a colour that reflect your mood, or just pick your favourite shade.', 'Select an item and a colour and buy!', 'New colors!', '1:Choose an item\r\n2:Select the color\r\n3:Preview'),
(17, 17, 1, 'Pura', 'ctlg_layout2', 'catalog_pura_headline1', 'catalog_pura_teaser1,', 'Introducing the Pura Collection...  This collection breathes fresh, clean air and cool tranquillity. Use it to create a special haven away from the hullabaloo of life outside the Hotel.', 'Click on the item you want for more information', NULL, NULL),
(18, 18, 1, 'Mode', 'ctlg_layout2', 'catalog_mode_headline1', 'catalog_mode_teaser1,', 'Introducing the Mode Collection...  Steely grey functionality combined with sleek designer upholstery. The person that chooses this furniture is a cool urban cat - streetwise, sassy and so slightly untouchable.', 'Click on the item you want for more information', '2: So shiny and new...', NULL),
(19, 19, 1, 'Accessories', 'ctlg_layout2', 'catalog_extra_headline1', 'catalog_extra_teaser1,', 'Is your room missing something?  Well, now you can add the finishing touches that express your true personality. And don''t forget, like everything else, these accessories can be moved about to suit your mood.', 'Click on the item you want for more information', '2: I herd u liek mudkips?', NULL),
(20, 20, 1, 'Bathroom', 'ctlg_layout2', 'catalog_bath_headline1', 'catalog_bath_teaser1,', 'Introducing the Bathroom Collection...  Have some fun with the cheerful bathroom collection. Give yourself and your guests somewhere to freshen up - vital if you want to avoid nasty niffs. Put your loo in a corner though...', 'Click on the item you want for more information', NULL, NULL),
(21, 21, 1, 'Plants', 'ctlg_layout2', 'catalog_plants_headline1', 'catalog_plants_teaser1,', 'Introducing the Plant Collection...  Every room needs a plant! Not only do they bring a bit of the outside inside, they also enhance the air quality! Do we give a fuck? Up to you!', 'Click on the item you want for more information', '2: OMG PEDOBAER IS AFTER ME!', NULL),
(40, 40, 5, '[staff] HC', 'ctlg_layout2', 'catalog_club_headline1', 'catalog_hc_teaser,', 'Welcome to the Club Shop! All ''Habbo Club membership gifts'' are available here, use them wisely you greedy cunt! We have sofas, butlers and all the happy stuff.', 'Click on the crap you want for more information', NULL, NULL);
